import React from 'react';
import './App.css';

// Constants 
import {INITIALCITI} from './constants/weather';

// Components
import WeatherLocation from './components/WeatherLocation';

function App() {
  return (
    <div className="App">

      <WeatherLocation city={INITIALCITI} />
    </div>
  );
}

export default App;
